import React from "react";

const Login = () => {
  return (
    <div className="login">
      <div className="form-group">
        <label>Username</label>
        <input type="text" placeholder="Username..." />
      </div>
      <div className="form-group">
        <label>Password</label>
        <input type="password" placeholder="Password..." />
      </div>
    </div>
  );
};

export default Login;
